import logo from "../../images/registerLogo.svg";
import "./Profile.css";
import { Link } from "react-router-dom";
import accLogo from "../../images/accLogo.png";

function Profile() {

    return (
    <div className ="profile">
        <div className="profile__header">
            <img className="profile__header-image" src={logo} alt="logo" />
            <div className="profile__navigation">
                <Link to="#">
                    <button className="profile__link">Фильмы</button>
                </Link>
                <Link to="#">
                    <button className="profile__link profile__link_saved-films">Сохраненные фильмы</button>
                </Link>
                <Link to="#">
                    <button className="profile__link profile__link_account">Аккаунт</button>
                </Link>
                <Link to="#">
                    <img src={accLogo} className="profile__account-icon" />
                </Link>
            </div>
        </div>
    </div>
    
        );
    }
    
    export default Profile;
